import type { CopyPastePluginState, EditorOptions, IEditor, PluginWithState } from 'roosterjs-editor-types';
/**
 * @internal
 * Copy and paste plugin for handling onCopy and onPaste event
 */
export default class CopyPastePlugin implements PluginWithState<CopyPastePluginState> {
    private editor;
    private disposer;
    private state;
    /**
     * Construct a new instance of CopyPastePlugin
     * @param options The editor options
     */
    constructor(options: EditorOptions);
    /**
     * Get a friendly name of  this plugin
     */
    getName(): string;
    /**
     * Initialize this plugin. This should only be called from Editor
     * @param editor Editor instance
     */
    initialize(editor: IEditor): void;
    /**
     * Dispose this plugin
     */
    dispose(): void;
    /**
     * Get plugin state object
     */
    getState(): CopyPastePluginState;
    private onCutCopy;
    private onPaste;
    private getTempDiv;
    private cleanUpAndRestoreSelection;
    private restoreRange;
    private createTableRange;
    private deleteTableContent;
    private deleteImage;
}
